import React, { useState } from 'react';


const App = () => {
  const [todos, setTodos] = useState([
    { id: 1, text: '리액트의 기초 알아보기', checked: true },
    { id: 2, text: '컴포넌트 스타일링해보기', checked: true },
    { id: 3, text: '일정관리 앱 만들어보기', checked: false },

  ])
  return (
    <TodoTemplate>
      <TodoInsert />
      <TodoList todos={todos} />
    </TodoTemplate>
  )
}


export default App;
